import React, { Component } from "react";
import "../css/default.min.css";
import { Link, BrowserRouter as Router } from "react-router-dom";

class Navbar extends Component {
  render() {
    return (
      <Router>
        <nav className="navigation">
      <ul></ul>
            <li>
              <a href="/Mainpage">Not a member? Sign in</a>
            </li>
            <li>
              <a href="/Pointspage">point</a>
            </li>

            <li>
              <a href="https://www.instagram.com/ufdreamteam/?hl=en">instagram</a>
            </li>
            <li>
              <a href="https://www.facebook.com/UFDreamTeam/">facebook</a>
            </li>
        </nav>
      </Router>
    );
  }
}

export default Navbar;
